import React, { useState } from "react";
import { useNavigate } from "react-router-dom"; // Replace useHistory with useNavigate

const CreateAI = () => {
  const [title, setTitle] = useState("");
  const [temperature, setTemperature] = useState(0.7); // Default value for temperature
  const [language, setLanguage] = useState("English"); // Default language
  const [isSubmitting, setIsSubmitting] = useState(false);
  const [errorMessage, setErrorMessage] = useState("");
  const navigate = useNavigate(); // Initialize useNavigate

  const handleSubmit = async (e) => {
    e.preventDefault();
    setIsSubmitting(true);

    try {
      const response = await fetch("http://localhost:5000/blog/AI", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify({ title, temperature, language }),
        credentials:"include"
      });

      const data = await response.json();

      if (response.ok) {
        // If successful, redirect to the newly created blog or to the blogs list
        navigate(`/blog/${data.blog._id}`); // Use navigate to redirect
      } else {
        setErrorMessage(data.error || "Failed to create blog.");
      }
    } catch (error) {
      setErrorMessage("An error occurred while creating the blog.");
      console.error("Error:", error);
    } finally {
      setIsSubmitting(false);
    }
  };

  return (
    <div className="ai-blog-container" style={{ padding: "2rem", maxWidth: "600px", margin: "auto" }}>
      <h2>Create Blog with AI</h2>
      <form onSubmit={handleSubmit}>
        <div>
          <label htmlFor="title">Title</label>
          <input
            type="text"
            id="title"
            value={title}
            onChange={(e) => setTitle(e.target.value)}
            required
            style={{ width: "100%", padding: "0.5rem", margin: "0.5rem 0" }}
          />
        </div>

        <div>
          <label htmlFor="temperature">Temperature</label>
          <input
            type="number"
            id="temperature"
            value={temperature}
            min="0.0"
            max="1.0"
            step="0.1"
            onChange={(e) => setTemperature(e.target.value)}
            required
            style={{ width: "100%", padding: "0.5rem", margin: "0.5rem 0" }}
          />
        </div>

        <div>
          <label htmlFor="language">Language</label>
          <select
            id="language"
            value={language}
            onChange={(e) => setLanguage(e.target.value)}
            required
            style={{ width: "100%", padding: "0.5rem", margin: "0.5rem 0" }}
          >
            <option value="English">English</option>
            <option value="Hindi">Hindi</option>
            <option value="Telugu">Telugu</option>
            <option value="Marathi">Marathi</option>
            <option value="French">French</option>
            <option value="German">German</option>
            <option value="Chinese">Chinese</option>
            <option value="Spanish">Spanish</option>
          </select>
        </div>

        {errorMessage && <p style={{ color: "red" }}>{errorMessage}</p>}

        <button type="submit" disabled={isSubmitting} style={{ padding: "0.7rem 1.5rem", backgroundColor: "#1E201E", color: "white", border: "none", cursor: "pointer" }}>
          {isSubmitting ? "Creating..." : "Create Blog"}
        </button>
      </form>
    </div>
  );
};

export default CreateAI;
